import React from 'react';

const app:React.FC = ()=>{
  const windowSizeX = window.innerHeight
  const windowSizeY = window.innerWidth

  const style = {
    top:windowSizeX/2 + "px",
    left:windowSizeY/2 + "px"
  }

  return (
  <div id='container' style={style}>
    <h1>로그인</h1>
    <h2>Username: <input name='username'></input></h2>
  </div>
  )
}

export default app;
